import React from 'react';

export default function BarraCategorias() {


  return (
    <Col lg="8" className='bg-dark'>
      <nav class="nav justify-content-center|justify-content-end">
      <Carousel>
      <CarouselItem>

      <Button variant="outline-primary" className='m-2'>Primary</Button>
      <Button variant="outline-primary" className='m-2'>Primary</Button>
      <Button variant="outline-primary" className='m-2'>Primary</Button>
      <Button variant="outline-primary" className='m-2'>Primary</Button>
      <Button variant="outline-primary" className='m-2'>Primary</Button>
      <Button variant="outline-primary" className='m-2'>Primary</Button>
      </CarouselItem>
      </Carousel>
      </nav>

    </Col>
  )
}
